import Stack from 'react-bootstrap/Stack';

function Menu() {
  return (
    <Stack direction="horizontal" gap={3}>
      <div className="text-light bg-dark">First item</div>
      <div className="text-light bg-dark">Second item</div>
      <div className="text-light bg-dark">Third item</div>
    </Stack>
  );
}

export default Menu;
